import './App.css';
import Navbar from './Navbar/Navbar.jsx';
import Footer from './Footer/Footer.js';
import NotFound from './Page-not-found/PageNoutFound.jsx';
import Main from './Main/Main.jsx';  // Make sure Main is imported correctly
import Login from './Login/Login.jsx';
import Register from './Sing-up/SignUp.jsx';
import Password from './Forget-password/Password.jsx';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<><Navbar /><Main /><Footer /></>} />
          <Route path="/Main" element={<><Navbar /><Main /><Footer /></>} />
          <Route path="/Login" element={<Login />} />
          <Route path="/Register" element={<Register />} />
          <Route path="/Password" element={<Password />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
